webpackJsonp([0x6dfa7ddad132],{430:function(e,i){e.exports={data:{markdownRemark:{html:'<h1>July 20, 2016</h1>\n<ul>\n<li>Michelle Noorali gave an introduction and overview of the agenda</li>\n<li>\n<p>Janet Kuo gave an overview of Deployment features</p>\n<ul>\n<li>See her <a href="http://blog.kubernetes.io/2016/04/using-deployment-objects-with.html">blog post</a></li>\n<li>See used <a href="https://github.com/kubernetes/minikube">minikube</a> for the local cluster set up during her demo</li>\n</ul>\n</li>\n<li>\n<p>Saad Ali gave an overview of Volume features and things to look forward to around Volumes</p>\n<ul>\n<li>Check out his <a href="https://docs.google.com/presentation/d/17w7GqwGE8kO9WPNAO1qC8NyS7dRw_oLBwqKznD9WqUs">presentation</a></li>\n</ul>\n</li>\n<li>We are looking forward to the sig-apps survey results next week</li>\n</ul>\n<p>Watch the <a href="https://youtu.be/DrLGxkFdDNc?list=PLI1CvzwXi1cUVsxm2QBIyJgeCkf62ylun">recording</a>.</p>'},site:{siteMetadata:{sigs:["sig-api-machinery","sig-apps","sig-architecture","sig-auth","sig-autoscaling","sig-aws","sig-azure","sig-big-data","sig-cli","sig-cloud-provider","sig-cluster-lifecycle","sig-cluster-ops","sig-contributor-experience","sig-docs","sig-gcp","sig-ibmcloud","sig-instrumentation","sig-multicluster","sig-network","sig-node","sig-openstack","sig-product-management","sig-release","sig-scalability","sig-scheduling","sig-service-catalog","sig-storage","sig-testing","sig-ui","sig-vmware","sig-windows"]}}},pathContext:{slug:"/sig-apps/minutes/2016-07-20/"}}}});
